import classes from './Overview.module.css';

import InstructorUnit from './InstructorUnit';
import InfoUnit from './InfoUnit';

import About from './About';
import {GiDogHouse} from 'react-icons/gi';
import {BsPeopleFill} from 'react-icons/bs';
import {FaHandPointRight} from 'react-icons/fa';
import {GrStatusGoodSmall} from 'react-icons/gr';


const Overview=()=>{



return (

<div className={classes.overview}>

     <div className={classes.instructorGrid}>
        <InstructorUnit/>
     </div>


     <div className={classes.generalInfoGrid}>


          <InfoUnit 
	         name="Institute" 
	         value="Kalinga Institute of Industrial Technology, Bhubaneswar, Odisha"
	         icon={GiDogHouse}
	         />

          <InfoUnit
                  name="Designed for"
                  value="Class-11"
	          icon={FaHandPointRight}
                  />

          <InfoUnit
                  name="No. of Students"
                  value="20"
	          icon={BsPeopleFill}
                  />



          <InfoUnit
	           name="Status"
	           value="ongoing"
	           icon={GrStatusGoodSmall}
	          />

          <InfoUnit
                   name="Institute code"
                   value="CS223"
	           icon={GiDogHouse}
                  />

          <InfoUnit
                   name="Duration"
                   value="22/05/2022 to 20/10/2022"
                   icon={GiDogHouse}
                  />

          <InfoUnit
                   name="Progress"
                   value="40% complete"
                   icon={GiDogHouse}
                  />

          <InfoUnit
                   name="Upcoming class"
                   value="9:30 am, Monday"
                   icon={GiDogHouse}
                  />



     </div>



     <div className={classes.aboutTheCourse}>

          <About/>

     </div>


     <div className={classes.recoBooks}>

          <div> Reccommended books</div>
          <div> Concept of Physics, HC Verma</div>

     </div>












</div>

);

}

export default Overview;
